  [],\n\t\"revision_timestamp\": \"2015-05-06T21:48:37.997358\",\n\t\"name\": \"vapor-compressor-driven-hybrid-two-phase-loop-project-4bdd3\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"The Phase I project successfully demonstrated
  the feasibility of the vapor compression hybrid two-phase loop (VCHTPL). The test
  results showed the high temperature-lift capability and robust operation under transient
  heat loads of the VCHTPL. At the end of Phase I, the VCHTPL technology reached the
  NASA's defined Technology Readiness Level (TRL) 4 (Component/breadboard validation
  in a laboratory environment).rnrnThe principal Phase II objective is to elevate
  the VCHTPL technology to NASA's Technology Readiness Level (TRL) 6: System/subsystem
  prototype demonstration in a relevant environment. This will be achieved through
  addressing the key technical and integration issues identified in Phase I of the
  proposed program. During Phase II, multiple generations of hardware will be designed,
  fabricated and tested to demonstrate the capability of the vapor compression loop
  technology in meeting the thermal performance, form factor, mass and reliability
  requirements for NASA's lunar missions. Five technical tasks plus a reporting task
  are planned to achieve the Phase II technical objectives. rn\",\n\t\"license_title\":
